import 'isomorphic-fetch';
import useRedirectToLogin from '../hooks/useRedirectToLogin';
import Layout from '../components/Layout';
import CardsContainer from '../components/CardsContainer';

const index = () => {
  useRedirectToLogin();
  return (
    <>
      <Layout title="Home">
        <CardsContainer toDo={[]} />
      </Layout>

      <style jsx global>
        {`
          * {
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </>
  );
};


export default index;
